import axios from 'axios'
import { useNavigate } from "react-router-dom";
import { useEffect } from 'react'
import { useSelector, useDispatch } from 'react-redux'
import React,{useState} from 'react';
import { styled, alpha } from '@mui/material/styles';
import Button from '@mui/material/Button';
import Menu from '@mui/material/Menu';
import MenuItem from '@mui/material/MenuItem';
import EditIcon from '@mui/icons-material/Edit';
import Divider from '@mui/material/Divider';
import ArchiveIcon from '@mui/icons-material/Archive';
import FileCopyIcon from '@mui/icons-material/FileCopy';
import MoreHorizIcon from '@mui/icons-material/MoreHoriz';
import KeyboardArrowDownIcon from '@mui/icons-material/KeyboardArrowDown';
import {fetchAllProducts } from "../../features/Product/ProductSlice";
import Product from './Product';
import Alert from '@mui/material/Alert';
import CircularProgress from '@mui/material/CircularProgress';
import ImageListItem from '@mui/material/ImageListItem';
import Box from '@mui/material/Box';


export default  function ProductList() {
const arrFromRedux = useSelector(s=>s.products.arrProducts)
const statusFetchData = useSelector(s => s.products.status)

    useEffect(() => {

      fetchAllProductsList()
    }, [])

    const fetchAllProductsList = async () => {
      if(statusFetchData=="idle")
           dispatch(fetchAllProducts())
    }

    const dispatch = useDispatch()
    // const StyledMenu = styled((props) => (
    //   <Menu
    //     elevation={0}
    //     anchorOrigin={{
    //       vertical: 'bottom',
    //       horizontal: 'right',
    //     }}
    //     transformOrigin={{
    //       vertical: 'top',
    //       horizontal: 'right',
    //     }}
    //     {...props}
    //   />
    // ))(({ theme }) => ({
    //   '& .MuiPaper-root': {
    //     borderRadius: 6,
    //     marginTop: theme.spacing(1),
    //     minWidth: 180,
    //     color:
    //       theme.palette.mode === 'light' ? 'rgb(55, 65, 81)' : theme.palette.grey[300],
    //     boxShadow:
    //       'rgb(255, 255, 255) 0px 0px 0px 0px, rgba(0, 0, 0, 0.05) 0px 0px 0px 1px, rgba(0, 0, 0, 0.1) 0px 10px 15px -3px, rgba(0, 0, 0, 0.05) 0px 4px 6px -2px',
    //     '& .MuiMenu-list': {
    //       padding: '4px 0',
    //     },
    //     '& .MuiMenuItem-root': {
    //       '& .MuiSvgIcon-root': {
    //         fontSize: 18,
    //         color: theme.palette.text.secondary,
    //         marginRight: theme.spacing(1.5),
    //       },
    //       '&:active': {
    //         backgroundColor: alpha(
    //           theme.palette.primary.main,
    //           theme.palette.action.selectedOpacity,
    //         ),
    //       },
    //     },
    //   },
    // }));
    
    //  function CustomizedMenus() {
      const [anchorEl, setAnchorEl] = React.useState(null);
      const open = Boolean(anchorEl);
      const handleClick = (event) => {
        setAnchorEl(event.currentTarget);
      };
      const handleClose = () => {
        setAnchorEl(null);
      };
    
    return  (
        <div>
           <Button
        id="demo-customized-button"
        aria-controls={open ? 'demo-customized-menu' : undefined}
        aria-haspopup="true"
        aria-expanded={open ? 'true' : undefined}
        variant="contained"
        disableElevation
        onClick={handleClick}
        endIcon={<KeyboardArrowDownIcon />}
      >
        Options
      </Button>
      <StyledMenu
        id="demo-customized-menu"
        MenuListProps={{
          'aria-labelledby': 'demo-customized-button',
        }}
        anchorEl={anchorEl}
        open={open}
        onClose={handleClose}
      >
        <MenuItem onClick={handleClose} disableRipple>
          <EditIcon />
          Edit
        </MenuItem>
        <MenuItem onClick={handleClose} disableRipple>
          <FileCopyIcon />
          Duplicate
        </MenuItem>
        <Divider sx={{ my: 0.5 }} />
        <MenuItem onClick={handleClose} disableRipple>
          <ArchiveIcon />
          Archive
        </MenuItem>
        <MenuItem onClick={handleClose} disableRipple>
          <MoreHorizIcon />
          More
        </MenuItem>
      </StyledMenu>
        <ul>
        {arrFromRedux &&<Box
sx={{
    display: 'grid',
    columnGap: 3,
    rowGap: 1,
    gridTemplateColumns: 'repeat(3, 1fr)',
    marginRight:4
  }}
>
          {arrFromRedux.map((item) => (
            <ImageListItem key={item.imgUrl}>
              <Product  myProduct={item}></Product>
            </ImageListItem>
            ))}
          </Box>}
        </ul>
        
        </div>
        
    )
}
